import * as React from "react";
import { View, Text } from "react-native";
import {Menu} from './assets/js/script.js'

export default function menu() {
  return (
    <View
      style={{
        backgroundColor: 'green',
      }}
    >
      <div id="menu">
        <a href="#news">News</a>
        <a href="#contact">Contact</a>
        <a href="#about">About</a>
      </div>
    </View>,
    <view>
      <a href='#' onClick={Menu}>
        menubutton
        </a>
    </view>
  );
}

menu();
